import React from 'react'

const PageNotFound = () => {
    return (
        <div id="wrapper">
            <img className="img-fluid" src="https://i.imgur.com/qIufhof.png" />
            <div id="info">
                <h3>This page could not be found</h3>
            </div>
        </div >
    )
}

export default PageNotFound
